import { nanoid } from "nanoid";
import Square from "./Square";

function Row(props) {
    for(let i = 0; i < props.rows.length(); i++) {
        return (
            <Square 
                value={props.value}
                key={'square-'+nanoid()}
            />
        );
    }
}
